.gitResult-container {
  height: 100%;
  font-size: 30px;
  padding: 0 20px;
  .send_px {
    width: 225px;
    height: 245px;
    margin: 50px auto 0;
    background: url('../../../assets/images/activity/give.png');
    background-size: cover;
    padding-top: 31px;
    .image_g {
      width: 86px;
      height: 123px;
      display: block;
      margin: 0 auto;
      transform: translateX(-12px);
    }
  }
  .result_text_g {
    padding: 20px 0;
    color: aqua;
    text-align: center;
  }
  .result-container-g {
    background-color: #ffffff;
    border-radius: 14px;
    margin-top: 30px;
    padding: 0 20px;
    .result_info {
      display: block;
      width: 100%;
      padding: 22px 15px;
      border-bottom: 1px #e0e1e1 solid;
      font-size: 28px;
      font-weight: normal;
      font-stretch: normal;
      letter-spacing: 0px;
      color: #787f8c;
      .left {
      }
      .right {
        text-align: right;
        .image_c {
          width: 53px;
          height: 75px;
        }
      }
    }
  }
  .button_gr {
    .bt_receive {
      width: 273px;
      height: 69px;
      background: url('../../../assets/images/activity/chakanjieshoujilu.png');
      background-size: cover;
    }
    .bt_send {
      width: 272px;
      height: 69px;
      background: url('../../../assets/images/activity/zaicizengsong.png');
      background-size: cover;
    }
  }
  .unborder {
    border: none !important;
  }
}

